import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import VideoList from './components/VideoList'; // Assurez-vous que le chemin est correct
import './index.css';

const App: React.FC = () => {
    return (
        <Router>
            <Routes>
                <Route path="/" element={<h1>Welcome to the YouTube Library</h1>} />
                <Route path="/user/:username" element={<VideoList />} />
            </Routes>
        </Router>
    );
};

ReactDOM.render(<App />, document.getElementById('root'));
export default App;
